import logo from './logo.svg';
import './App.css';
import Header from './components/header';

function App() {
  return (
    <div className="App">
      <Header />
      <br />
      <h3>مرحبًا بكم في موقع ثانوية الفيصلية الرسمي.</h3>
    </div>
  );
}

export default App;
